import React from "react";

import "./AddUser.css";

const AddUser = (props) => {
  return (
    <form>
      <label htmlFor="username">Username</label>
      <input id="username" type="text" />
      <label htmlFor="age">Age (Years)</label>
      <input id="username" type="number" />
    </form>
  );
};

export default AddUser;
